import { useState } from "react";

function Test() {
  const [count, setCount] = useState(0);

  function add() {
    setCount(() => count + 1);
  }
  function minus() {
    setCount(() => count - 1);
  }

  return (
    <div>
      <button onClick={minus}>minus</button>
      <br></br>
      <span>{count}</span>
      <br></br>
      <button onClick={add}>add</button>
    </div>
  );
}

export default Test;
